import React from 'react'
import CartItem from './CartItem';

const Cart = ({products}) => {

  console.log(products);

  return (
    <div>  
     {products.map( (product) => 
      <CartItem 
         key={product.id} 
         product={product}>
     </CartItem>)}
    </div>
  )
}

export default Cart
